Hi, first time asking for help here. Our rookie team is trying to prototype with pneumatics, unfortunately it seems the compressor is not working. I confirmed it functionally works by attaching power directly to it. I read in the documentation that it should automatically pressurize to 120 psi upon the Solenoid class being called but it seems that isn’t happening(I’m using an edited version of the solenoid example code). Here is the current code(very barebones and used just to see if we can get pneumatics to work at all.) Should I change the code or is there any firmware I should update? Thanks for any and all help!

Parts being used: Compressor given in kit, Pressure switch given in kit, solenoid given in kit, CrossTheRoads Pneumatics Control Module. Wiring Diagram Followed

CODE:

package frc.robot;

import edu.wpi.first.wpilibj.XboxController; import edu.wpi.first.wpilibj.PneumaticsModuleType; import edu.wpi.first.wpilibj.Solenoid; import edu.wpi.first.wpilibj.TimedRobot;

public class Robot extends TimedRobot { private final XboxController m_stick = new XboxController(0); private final Solenoid m_solenoid = new Solenoid(PneumaticsModuleType.CTREPCM, 0);

private static final int kSolenoidButton = 1;

@Override public void teleopPeriodic() { m_solenoid.set(m_stick.getRawButton(kSolenoidButton));

} }
